広告文責/販売会社:株式会社Hanbit TEL:050-1040-7307<br><br><br><br><font color="#BF0000"><b>■関連商品</b></font><hr color="#BF0000"><br><b>本商品のサイズ、色違い、関連商品はこちら</b><br><br><br><font color="#BF0000"><b>■商品内容</b></font><hr color="#BF0000"><br> 車種別リアセット！カット済みなので貼りやすく作業効率UP！カットデータは各 車種の工業用ガラス製品データを使用しているため、プロ仕様の精度です。貼り方説明書付き。<br>【適合】・車名：トヨタ プロナード・型式：MCX20・年式：H12.4～15.1・内容：リア（3枚重ね貼り）／リアドア左右各1枚／サイドウィンドウ左右各1枚<br>【使用フィルムデータ】・フィルム色：ダークスモーク・可視光線透過率（Visible Light TRansmittance）：9%・赤外線カット率（IR Heat Reject）：12%・紫外線カット率（UV Block）：99%<br>【カーフィルムの効果】★紫外線99%カット！<br>★日差しを防ぎ、車内の冷房効率アップ！<br>★外から見えにくくなるのでプライバシー保護にも<br>★万一ガラスが割れた際は飛散しにくい <br>【注意事項】※ご注文前に 車種・タイプ／グレード・年式・型式・窓／ドア数・貼り付け部位をよくご確認いただいてからご注文ください。受注生産品のため、商品注文後のキャンセル、サイズ違いによる返品・交換は承りかねます。※ 車種・型式・年式・タイプ等の他、車両本体の個体差による多少の誤差が生じます。作業する前に必ず自車のガラスに合わせて型取りし、大きい場合は余分な個所をカットして下さい。※間違い防止のため、フィルム貼付前に上下、左右、裏表をよくご確認ください。※端子・ランプ等の穴は開いておりませんので、お車に合わせてカットしてください。※フィルム貼り付けの施工道具等は付属しておりません。※改良の為、商品仕様は予告なしに変更することがあります。<br><br><br><font color="#BF0000"><b>■商品スペック</b></font><hr color="#BF0000"><br>【商品名】<br>カット済みカーフィルム トヨタ プロナード MCX2# リアセット ダークスモーク<br>【梱包サイズ】<br>50 x 40 x 30 cm<br>【重量】<br>998 g<br>【注意事項】<br>注意事項 ※ご注文前に車種・タイプ／グレード・年式・型式・窓／ドア数・貼り付け部位をよくご確認いただいてからご注文ください。受注生産品のため、商品注文後のキャンセル、サイズ違いによる返品・交換は承りかねます。※車種・型式・年式・タイプ等の他、車両本体の個体差による多少の誤差が生じます。作業する前に必ず自車のガラスに合わせて型取りし、大きい場合は余分な個所をカットして下さい。 ※間違い防止のため、フィルム貼付前に上下、左右、裏表をよくご確認ください。 ※端子・ランプ等の穴は開いておりませんので、お車に合わせてカットしてください。 ※フィルム貼り付けの施工道具等は付属しておりません。 ※改良の為、商品仕様は予告なしに変更することがあります。<br><br><br><br><font color="#BF0000"><b>■送料・配送についての注意事項</b></font><hr color="#BF0000"><br>●本商品の出荷目安は<b>【1 - 5営業日　※土日・祝除く】</b>となります。<br><br>●お取り寄せ商品のため、稀にご注文入れ違い等により欠品・遅延となる場合がございます。<br><br>●本商品は同梱区分<b>【TS1838】</b>です。同梱区分が<b>【TS1838】</b>と記載されていない他商品と同時に購入された場合、梱包や配送が分かれます。<br><br>●沖縄、離島および一部地域への配送時に追加送料がかかる場合がございます。<style type="text/css">
